class Room{constructor(n,t,i){this.id=n;this.creatorId=t;this.currentUserId=i}}class Error{constructor(n,t){this.caption=n;this.message=t}}window.ZokuChat.chat={};window.ZokuChat.chat.room=null;var app=new Vue({el:"#chat-app",data:{window:window,connection:(new signalR.HubConnectionBuilder).withUrl("/chatHub").build(),messages:[],errors:[]},methods:{init:()=>{app.connection.on("ReceiveMessages",function(n){n.forEach(function(n){app.messages.push(n)})});app.connection.on("ReceiveMessage",function(n){app.messages.push(n)});app.connection.on("ReceiveError",function(n,t){app.errors.push(n,t)});app.connection.start().catch(function(n){return console.error(n.toString())}).then(function(){app.joinRoom().then(function(){app.retrieveMessages()})})},joinRoom:()=>app.connection.invoke("JoinRoom",window.ZokuChat.chat.room.id).catch(function(n){return console.error(n.toString())}),retrieveMessages:()=>app.connection.invoke("GetMessages",window.ZokuChat.chat.room.id).catch(function(n){return console.error(n.toString())}),sendMessage:n=>app.connection.invoke("SendMessage",window.ZokuChat.chat.room.id,n).catch(function(n){return console.error(n.toString())})}});